import React from "react";
import { useState } from "react";
import FilledStar from "./FilledStar";
import NotFilledStar from "./NotFilledStar";
import '../styles/Swan.scss'

function Swan(){

    const [featured, setFeatured] = useState(false)
    const [process, setProcess] = useState(0)

    return <div className="swan">
    <div className="swanTop">
      <div className="swanLeft">
        <div className="name">lebed.jpg</div>
        {process === 0 ? <div className="process"><p>Распознано</p><img src="Icons/Ok.svg"/></div>
        : (process === 1 ? <div className="process"><p>Частично</p><img src="Icons/Normal.svg"/></div>
        : <div className="process"><p>Не распознано</p><img src="Icons/Not.svg"/></div>)}
        <div className="date">20.04.2001  12:00</div>
      </div>
      <div className="swanRight">
        <div className="star" onClick={()=>{setFeatured(!featured)}}>
            {featured ? <FilledStar/> : <NotFilledStar/>}
        </div>
        <div className="bin">
            <img src='Icons/trash.svg'/>
        </div>
      </div>
    </div>
    <div className="swanBottom">
      <div className="swanInfo">Лебеди: 10</div>
      <div className="swanInfo">Шипуны: 17</div>
      <div className="swanInfo">Кликуны: 3</div>
      <div className="swanInfo">Всего: 33</div>
    </div>
  </div>
}

export default Swan;
